    css: string | undefined ;
    label: string | undefined;
};

export const Button: FunctionComponent<PropsButton>  =({ css, label, ...props }) => {

  return (    
    <div className={Style.Button} id='Button'>
      <img src='./Icon.png'></img>
      <label>{label}</label>     
      <label>{label}</label>   
    </div>
  );
};
